import { BrowserRouter, Route, Switch } from 'react-router-dom';
import './App.css';
import Footer from './Footer/Footer';
import Header from './Header/Header';
import Home from './Home/Home';

function App() {
  return (
    <div className="App">
      <BrowserRouter>

        <Header />

        <Switch>

          <Route exact path="/react-document" component={Home}/>

        </Switch>

        <Footer />

      </BrowserRouter>

    </div>
  );
}

export default App;
